import React, { Suspense } from "react";
import Loadable from "react-loadable";

import "./App.css";
import Price from "../Componets/Price";
import Container from "react-bootstrap/Container";
import Row from "react-bootstrap/Row";
import Col from "react-bootstrap/Col";
import Spinner from "react-bootstrap/Spinner";

import { Provider } from "react-redux";
import { store } from "../redux/store";

const dynamicImport = (importingComponent) =>
  Loadable({
    loader: importingComponent,
    loading: Spinner,
  });

const ChatbotComponent = dynamicImport(() => import("../Componets/Chatbot"));
const ListHistory = dynamicImport(() => import("../Componets/ListHistory"));

const App = () => {
  return (
    <Provider store={store}>
      <Container>
        <Row>
          <Col xs={12} md={8}>
            <Suspense fallback={<div>Loading...</div>}>
              <Row>
                <Price />
                <ListHistory />
              </Row>
            </Suspense>
          </Col>

          <Suspense fallback={<div>Loading...</div>}>
            <Col xs={6} md={4}>
              <ChatbotComponent />
            </Col>
          </Suspense>
        </Row>
      </Container>
    </Provider>
  );
};

export default App;
